import React from 'react';

class Section3 extends React.Component{
	constructor(props){
	   super(props);	
	}

	render(){
		return(
		<>
		   {  
				<>
				<br/>
				<div style={{ textAlign: 'center' }}>
				Posizioni:
				<br/> 
				{this.props.posizioni.map((posizione, corridore) => (
					<div key={corridore}>
						Corridore {corridore + 1}:
						<input 
							type="text" 
							readOnly 
							value={`${posizione}`}
							/> 
					</div>
				))}
				</div>
				</>
		   }
		 </>
		);
	}

}
export default Section3;
